import React from "react";

function PopupWithImage({ card, onClose, isOpen }) {
  //console.log(card.link);
  const { name, link } = card;
  return (
    <div
      className={
        isOpen ? `popup popup__image popup_is-opened` : `popup popup__image`
      }
    >
      <div className="popup__container">
        <img
          className="popup__image"
          alt={name}
          src="https://media-exp1.licdn.com/dms/image/C4D03AQFAvkqhsCREXA/profile-displayphoto-shrink_200_200/0?e=1600905600&v=beta&t=o-SLktL-DVgwl3fTH31kQJqYT-obygUe-R_ltvFfmEo"
        />
        <h2 className="popup__image-title">{name}</h2>
        <button className="button button_close" onClick={onClose} />
      </div>
    </div>
  );
}

export default PopupWithImage;
